import SkillTile from "./SkillTile";
import skills from "./skillsdata";

function SkillsDirectory() {
  return (
    <div>
        {skills.map(skill => (
            <SkillTile key={title + skill.title} title={skill}/>
        ))}
    </div>
  );
}

export default SkillsDirectory;
